import { useEffect, useState } from "react";

function App(){
  const [dataState, setDataState] = useState({
    loaded: false,
    data: {}
  });

  function dataLoading(){
    fetch('#')
    .then(response => response.json())
    .then(jsondata=> setDataState(jsondata))
    .catch(error=>console.log(error))
  }

  useEffect(()=>{
    dataLoading()
  },[])

  return <>
    <p>{dataState}</p>
  </>
}

export default App;
